Tales of south - 
Mulakkaram, also known as the "breast tax" was a head tax imposed on the Nadars, Ezhavars and other lower caste communities by the Kingdom of Tranvancore. According to local beliefs the breast tax was imposed to lower class women if they covered their breasts.
The village-legend of Nangeli, a toddy tapper who wore choir around her neck supposedly, cut off her breasts in an effort to protest against a caste-based "breast tax".

